  \"Vibrational Locomotion Enabling Subsurface Exploration of Unconsolidated Regolith
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-07T01:31:38.316137\",\n\t\"name\":
  \"vibrational-locomotion-enabling-subsurface-exploration-of-unconsolidated-regolith-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The idea of vibrational locomotion
  is based on vibrational-fluidization in ISRU reactor systems, which has proven very
  effective for regolith mixing. The vibrating device would essentially vibro-fluidize
  the local regolith surrounding it, reducing the local bulk density. With proper
  design (size, shape, weight) the device could gradually sink into the regolith.
  Vibration is also used in industrial digging applications as a supplement to a constant
  forward force. The vibration helps to reduce friction between the soil and the digging
  tool. Including a percussive motion to the proposed device would produce such a
  downward force and mimic industrial techniques.&lt;/p&gt;\",\n\t\"license_title\":
